    function OpenAdminpage(){
        
        navigate("/adminPage")
    }
    return (
        <div>
            <div class="d-flex">
                <img src="https://www.logolynx.com/images/logolynx/a6/a68cf673b01d3f6dcaa98119d5baf8b1.jpeg" width="100px" height="100px"></img>
                <div>
                    
                </div>
            HomePage
            <br></br>
            
            </div>
            <button onClick={OpenAdminpage}>cilck here</button>
        </div>
    )
}

export default Home
